  `before_eth_coin` decimal(50,18) NOT NULL DEFAULT '0.000000000000000000' COMMENT 'eth变动前数量',
  `eth_tag` tinyint(1) NOT NULL DEFAULT '1' COMMENT '变动符号 1 增加 -1 减少',
